import Auth from "@/models/Auth";

export default (to, from, next) => {
  let auth = Auth.check();

  if( !auth ) {
    next({ name: 'Login' });
  } else {
    if (to.name === 'login' || to.name === 'register') {
      next({ name: 'Dashboard' })
    }
  }
}
